/*Table structure for table `readmission` */

DROP TABLE IF EXISTS `readmission`;

CREATE TABLE `readmission` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `pname` varchar(200) DEFAULT NULL,
  `age` varchar(200) DEFAULT NULL,
  `pid` varchar(200) DEFAULT NULL,
  `email` varchar(200) DEFAULT NULL,
  `mobile` varchar(200) DEFAULT NULL,
  `sub` varchar(200) DEFAULT NULL,
  `drugdetails` varchar(200) DEFAULT NULL,
  `dunit` varchar(200) DEFAULT NULL,
  `sideeffect` varchar(200) DEFAULT NULL,
  `dosf` varchar(200) DEFAULT NULL,
  `stdate` varchar(200) DEFAULT NULL,
  `endate` varchar(200) DEFAULT NULL,
  `dstatus` varchar(200) DEFAULT NULL,
  `parents` varchar(200) DEFAULT NULL,
  `address` varchar(200) DEFAULT NULL,
  `treatement` varchar(2000) DEFAULT NULL,
  `diseasesp` varchar(200) DEFAULT NULL,
  `conditions` varchar(200) DEFAULT NULL,
  `labreports` varchar(200) DEFAULT NULL,
  `ptype` varchar(200) DEFAULT NULL,
  `blood` varchar(200) DEFAULT NULL,
  `symptoms` varchar(200) DEFAULT NULL,
  `status` varchar(200) DEFAULT NULL,
  `rcount` varchar(222) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=latin1;

